        setPlayer("X");
      }
    }
  }

  const changeColor5 = () =>{
    if(button5 === "white"){
      if(player === "X"){
        setButton5("red");
        setPlayer("O");
      }
      else{
        setButton5("blue");
        setPlayer("X");
      }
    }
  }

  const changeColor6 = () =>{
    if(button6 === "white"){
      if(player === "X"){
        setButton6("red");
        setPlayer("O");
      }
      else{
        setButton6("blue");
        setPlayer("X");
      }
    }
  }

  const changeColor7 = () =>{
    if(button7 === "white"){
      if(player === "X"){
        setButton7("red");
        setPlayer("O");
      }
      else{
        setButton7("blue");
        setPlayer("X");
      }
    }
  }

  const changeColor8 = () =>{
    if(button8 === "white"){
      if(player === "X"){
        setButton8("red");
        setPlayer("O");
      }
      else{
        setButton8("blue");
        setPlayer("X");
      }
    }
  }

  const changeColor9 = () =>{
    if(button9 === "white"){
      if(player === "X"){
        setButton9("red");
        setPlayer("O");
      }
      else{
        setButton9("blue");
        setPlayer("X");
      }
    }
  }




  return (
    <div className="App">
      <button onClick={(e)=> changeColor1()}>
                  {button1}
             </button>
      <button onClick={(e)=> changeColor2()}>
                  {button2}
             </button>
      <button onClick={(e)=> changeColor3()}>
                  {button3}
             </button> <br/>
      <button onClick={(e)=> changeColor4()}>
                  {button4}
             </button>
      <button onClick={(e)=> changeColor5()}>
                  {button5}
             </button>
      <button onClick={(e)=> changeColor6()}>
                  {button6}
             </button> <br/>
      <button onClick={(e)=> changeColor7()}>
                  {button7}
             </button>
      <button onClick={(e)=> changeColor8()}>
                  {button8}
             </button>
      <button onClick={(e)=> changeColor9()}>
                  {button9}
             </button> <br/>
    </div>
  );
}

export default App;
